import "../css/Home.css";
import Navbar from "../components/Navbar";
import { useState } from "react";
import { useNavigate } from "react-router-dom";

const Home = () => {
  const [open, setIsOpen] = useState(false);

  const openForm = () => {
    setIsOpen(true);
    console.log(open);
  };

  return (
    <div>
      <Navbar />
      <div className="page-body">
        <button
          onClick={() => {
            openForm;
          }}
        >
          Create new access code!
        </button>
        <h1 style={open ? "display: block" : "display:none"}></h1>
      </div>
    </div>
  );
};

export default Home;
